    public function setupDataSet1(): void
    {
        $this->set = $this->createFuzzyStringSet(self::DATA_SET_1);
        $this->set->add(self::DATA_SET_1[0]);
        $this->set->addMany(array_slice(self::DATA_SET_1, 0, 2));
    }

    #[Iterations(5)]
